package ssafy;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.ArrayList;
import java.util.Collections;
import java.util.List;
import java.util.StringTokenizer;

public class case1 {
    private static int testCase, N, M;
    private static List<Integer> correct, wrong;

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        testCase = Integer.parseInt(br.readLine());

        StringTokenizer st;
        StringBuilder sb = new StringBuilder();
        for(int i = 1; i <= testCase; i++) {
            st = new StringTokenizer(br.readLine());
            N = Integer.parseInt(st.nextToken());
            M = Integer.parseInt(st.nextToken());

            correct = new ArrayList<>();
            st = new StringTokenizer(br.readLine());
            for (int j = 0; j < N; j++) {
                correct.add(Integer.parseInt(st.nextToken()));
            }

            wrong = new ArrayList<>();
            st = new StringTokenizer(br.readLine());
            for (int j = 0; j < M; j++) {
                wrong.add(Integer.parseInt(st.nextToken()));
            }

            int ans = findLimit();
            if (ans == Integer.MAX_VALUE) {
                ans = -1;
            }

            sb.append("#").append(i).append(" ").append(ans);
            if (i != testCase) {
                sb.append("\n");
            }
        }
        System.out.println(sb.toString());
    }

    private static int findLimit() {
        Collections.sort(correct); // case 1
        Collections.sort(wrong); // case 2

        int min = correct.get(0), max = wrong.get(0);
        int start = correct.get(correct.size() - 1), end = wrong.get(0) - 1;
        int ans = Integer.MAX_VALUE;

        while (start <= end) {
            int mid = (start + end) / 2;

            if (mid >= min * 2) {
                end = mid - 1;
                ans = Math.min(ans, mid);
            } else {
                start = mid + 1;
            }
        }

        return ans;
    }
}

